import React from 'react';
import "./ContactUs.css";

const ContactUs = () => (
    <div className="Contact">
        <div className="lander">
            <h1>Contact Page</h1>
            <br/>
            <p>This is the contact page!</p>
        </div>
    </div>
);

export default ContactUs;
